import React from "react";
import { NavLink } from "react-router-dom";

const Card = (props) => {
  return (
    <>
      <div className="col-md-4 col-12 mx-auto">
        <div className="card">
          <img src={props.imgsrc} className="card-img-top" alt={props.imgsrc} />
          <div className="card-body">
            <h5 className="card-title font-weight-bold">{props.title}</h5>
            <p className="card-text">
              Lorem, ipsum dolor sit amet consectetur adipisicing elit. Ipsam eligendi quibusdam, laborum dolorum, voluptates esse vero deleniti magni ipsa accusamus cum dolores deserunt minus voluptas eveniet non? Officia, rerum perferendis.
            </p>
            <NavLink to="" className="btn btnn">
              Check Now
            </NavLink>
          </div>
        </div>
      </div>
    </>
  );
};

export default Card;
